import { lazy } from "react";
import IntroContent from "../../content/IntroContent.json";

import UnderConstruction from "../../content/UnderConstruction.json";


const Contact = lazy(() => import("../../components/ContactForm"));
const MiddleBlock = lazy(() => import("../../components/ContentBlock/MiddleContentBlock"));
const Container = lazy(() => import("../../common/Container"));
const ScrollToTop = lazy(() => import("../../common/ScrollToTop"));
const ContentBlock = lazy(() => import("../../components/ContentBlock"));

const Food = () => {
    return (
        <Container padding="20% 20%" maxWidth="1700px">
            <ScrollToTop />
            <img 
                style={{ position: "absolute", left: "50%", transform: "translateX(-50%)", top: "10%" }}
                src="/img/images/under-construction.gif" 
                alt="" 
            />
            <h1 style={{ "color": "black" }}> {UnderConstruction.title} </h1>
            <p style={{ "color": "black" }}> {UnderConstruction.content} </p>
        </Container>
    )
}

export default Food;
